import styled from 'styled-components'

export const HeaderContainer = styled.header`
    width: 100%;
    text-align: center;
    font-size: 2rem;
    font-weight: 700;
    background: burlywood;
    padding: 1rem;
    border-bottom: 1px solid black;    
`

export const HeaderSpan = styled.span`
    color: red;
`
